column8:
●優れた性能で、脱衣時のパチパチやスカートのまつわりつきなど衣類の不快な静電気を瞬時に除去できます<br>
●事前にスプレーしておけば、静電気の発生を防げます<br>
●車のシートに使うと、車の乗り降りの時に発生する静電気によるトラブルを防ぎます<br>
●カーテンや布製ソファなどのホコリの吸いつき・黒ずみを抑制<br>
●静電気を防止するので、花粉の衣類への付着を予防できます<br>
●使用シーンを分かりやすく表現したパッケージデザイン<br><br>

＜ジャケットに＞<br>
＜車のシートに＞<br>
＜マフラーに＞<br><br>

・速乾性なので着たままスプレーでき、外出前や外出先などいつでも気軽に使えます<br>
・抗菌効果があり、衣類を清潔に保ちます<br>
・衣類に残らない微香性<br><br>

【使い方】<br>
 約20cm離して、すれあう部分に均一にスプレーします<br><br>

 衣類以外に使える場所<br><br>

・ 車の布製シート：降りる時にビリッと感じる静電気を防ぎます。 <br>
・ カーテン、布製のソファ：ほこりの吸い付き、黒ずみを抑制できます。 <br><br>

※着ている衣類には、必ず自分でスプレーをしてください。<br>
※他人がスプレーすると、まれに静電火花が発生して衣類を焦がすことがあります。<br><br>

ライオン株式会社 130-8644 東京都墨田区本所1-3-7 TEL 0120-556-973<br>
